function Map.init(self)
  self.nodes = {}
  for x=0,255 do
    for y=0,255 do
      table.insert(self.nodes, { x = x, y = y, cost = self:cost(x, y)})
    end
  end
end

function Map.dump(self) 
  local f = io.open('mymap.lua', 'w')
  f:write("Map.map = {\n")
  for i=1,256 do
    f:write("{")
    for j=1,256 do
      f:write(string.format("%3d", self.map[i][j]))
      if j < 256 then
        f:write(",")
      end
    end
    if i < 256 then
      f:write("},\n")
    else
      f:write("}\n")
    end
  end
  f:write("}}")
  f:close()
end

function Map.setTile(self, x, y, tile)
  self.map[x+1][y+1] = tile
  self.nodes[x * 256 + y + 1].cost = self:cost(x, y)
end

function Map.cost(self, x, y)
  if     self.map[x+1][y+1] == 0x0 then --grass
    return 1
  elseif self.map[x+1][y+1] == 0x1 then --desert
    return 3
  elseif self.map[x+1][y+1] == 0x2 then --hill
    return 3
  elseif self.map[x+1][y+1] == 0x3 then --stairs up
    return 1
  elseif self.map[x+1][y+1] == 0x4 then --brick
    return 2
  elseif self.map[x+1][y+1] == 0x5 then --stairs down
    return 1
  elseif self.map[x+1][y+1] == 0x6 then --swamp
    return 2
  elseif self.map[x+1][y+1] == 0x7 then --town
    return 1 --?
  elseif self.map[x+1][y+1] == 0x8 then --cave
    return 1 --?
  elseif self.map[x+1][y+1] == 0x9 then --castle
    return 1 --?
  elseif self.map[x+1][y+1] == 0xa then --bridge
    return 1 --?
  elseif self.map[x+1][y+1] == 0xb then --forest
    return 2
  elseif self.map[x+1][y+1] == 0xc then --treasure chest
    return 1
  elseif self.map[x+1][y+1] == 0xd then --barrier
    return 2
  else
    return 1
  end
end


function Map.getnode(self, x, y)
  return self.nodes[x * 256 + y + 1]
end


-- Overrides for astar
function is_valid(node1, node2)
  return math.abs(node1.x - node2.x) == 1 and node1.y == node2.y 
    and math.abs(node1.y - node2.y) == 1 and node1.x == node2.x 
    and node2.cost < 127
end

function dist_between(current, neighbor)
  return neighbor.cost
end


function neighbor_nodes(current, nodes)
  neighbors = {}
  if current.x > 0 then
    table.insert(neighbors, map:getnode(current.x-1, current.y  ))
  end
  if current.x < 256 then
    table.insert(neighbors, map:getnode(current.x+1, current.y  ))
  end
  if current.y > 0 then
    table.insert(neighbors, map:getnode(current.x  , current.y-1))
  end
  if current.y < 256 then
    table.insert(neighbors, map:getnode(current.x  , current.y+1))
  end
  return neighbors
end

map = Map
map:init()

